(1, '2021-05-04 13:23:04.965000', '2021-07-09 10:53:25.168378', 'bannersubtitle', 'Invest more, Earn more', 'Get Ready to Join the revolutionary <b><span>DXB Token</span></b>', 1, 0, 1, 1),
(2, '2021-05-04 13:55:08.932000', '2021-07-09 10:53:46.557426', 'bannercontentone', 'Invest Content', 'No need to farm, stake, or deposit. Simply hold your tokens in your wallet and get more value in BNB. As the price of DXB increases with every transaction due to an intelligent smart contract that burns part of the fee and rewards you with BNB. The monthly cycle burns guarantee an ever-decreasing supply, and ever-growing price.', 1, 0, 1, 1),
