(14, '2021-05-04 14:35:53.126000', '2021-07-23 00:20:21.815425', 'tokenheading', 'Token Sale', '<p>The token sale of DXB aims to achieve an orderly, organized and democratic distribution of a fraction of the tokens. The first round of Token Sale will take place on 28th July 2021.&nbsp;</p>\r\n\r\n<p>The token sale will be achieved through the DxSale entity <u><a href=\"www.dxsale.app\">www.dxsale.app</a></u> . The process will start with a pre-sale of 14% of the supply divided in two rounds. Any extra tokens left from the presale will be automatically sent to the burn address, reducing the supply even before the PancakeSwap listing. The sale will also be supplemented by a 11% airdrop to facilitate wider adoption.</p>\r\n&nbsp;\r\n\r\n<p>The token sale is built to limit the creation of &ldquo;whale&rdquo; wallets, as no presale buyer can hold more than 1% of the supply. The token sale will be monitored by the experienced DxSale <u><a href=\"www.dxsale.app\">www.dxsale.app</a></u> platform, a dedicated startup for tokenization and token sale as a service. Well-curated token sales with a fair distribution serve to build trust and create credibility for the project.</p>', 1, 0, 1, 1),
(15, '2021-05-04 14:37:00.838000', '2021-05-18 09:28:54.219000', 'tokenvalue', 'Total holders', '1,500,000+', 1, 0, 1, 1),
