(19, '2021-05-04 14:38:56.505000', '2021-05-18 10:58:49.072018', 'tokenburned', 'DXB in the Press', '<ul>\r\n	<li>Lorem Ipsum is printer a galley of type and scrambled it to make type specimen book.</li>\r\n	<li>Lorem Ipsum is printer a galley of type and scrambled it to make type specimen book.</li>\r\n	<li>Lorem Ipsum is printer a galley of type and scrambled it to make type specimen book.</li>\r\n	<li>Lorem Ipsum is printer a galley of type and scrambled it to make type specimen book.</li>\r\n</ul>', 1, 0, 1, 1),
(20, '2021-05-04 14:48:18.091000', '2021-06-11 10:13:16.976375', 'howitstart', 'FooterContent', 'DXB is committed to a long-term vision of creating a sustainable and powerful ecosystem that revolutionises the way we invest, trade and donate.', 1, 0, 1, 1),
(21, '2021-05-04 14:51:20.223000', '2021-06-11 08:35:42.367820', 'howtobbf', 'Newsletter', 'Get our latest updates', 1, 0, 1, 1),
(22, '2021-05-18 10:59:53.506329', '2021-05-18 10:59:53.506365', 'aboutfooter', 'About', '', 1, 0, 1, 1),
