(24, '2021-05-19 06:12:55.795767', '2021-06-28 16:12:24.980939', 'aboutuspage', 'About US', '<p>In 2021, the battle against the global pandemic has forced the world to embrace<br />\r\ndigital initiatives in a parabolic trajectory. DXB aims to harness the chance to channel<br />\r\nthis into charitable acts and smart ecosystem that can benefit everyone.<br />\r\nThis could help make the world a better place.<br />\r\nDXB understands the mechanisms of Trading and exchanging a currency for the a<br />\r\nproduct or a service,<br />\r\nIn order to facilitate this exchange, and since most merchants are not necessarily<br />\r\ninvolved in cryptocurrency or accepts crypto coins as a form of payment, due to the<br />\r\nvolatility of the prices and other technical and security reasons, DXB is developing a<br />\r\nstate-of-art solution for this problem.</p>\r\n\r\n<p>DXB is a decentralized, cross-chain, token management service. Its aim is to deliver a smart ecosystem, coupled with a generous program, expedited via the token. DXB aims to apply the possibilities presented by BSC, to create a cross-chain payment protocol.<br />\r\n<br />\r\nThis product of DXB development will utilize blockchain technology to facilitate the<br />\r\npayments through cryptocurrency and offer a solution and a bridge that is secure and<br />\r\nprofitable for both the merchant and the consumer (DXB Holder).<br />\r\nThis will open up a world of possibilities and partnerships DXB can build with any<br />\r\nmerchant of any type of product, and anywhere in the world.</p>', 0, 0, 1, 1),
(25, '2021-05-19 06:13:29.281422', '2021-07-07 15:39:09.759488', 'aboutuscontent1', 'Complete Eco-System', 'DXB’s team of developers are in process of developing a state-of-art software that will serve as payment gateway for all DeFi tokens, once deployed, DXB software will allow regular merchants who sell their products online on mass scale to accept crypto currency as a form of payment in an easy and secure way.\r\n\r\nThis DXB solution will not only address the value fluctuation caused by price volatility, it will present new safety measures to reduce security risks associated while taking in considerations the commercial aspects of a transaction.\r\n\r\nOnce deployed, DXB software will change the way cryptocurrency “Specially Defi” is perceived and will create a whole new world of possibilities.\r\n\r\nThink of Uber, Booking.com, Deliveroo, Airlines, and any merchant accepting DXB as a form of payment in addition to other tokens.\r\n\r\nDXB team is in process of recruiting large chains of products and services who are excited to utilize the crypto revolution to their advantage and to offer a whole new world of services to the clients.\r\n\r\nMore on this topic soon.', 0, 0, 1, 1),
(26, '2021-05-19 06:13:58.620671', '2021-06-28 16:15:15.829974', 'aboutuscontent2', 'Technical', '<p>DXB is a BEP20 token issued on the Binance Smart Chain with a total fixed supply of<br />\r\n500 Trillion tokens.<br />\r\nThe ideation of DXB as a token with a smart ecosystem and charitable purposes will<br />\r\nenter a pre-sale campaign which will be hosted by DxSale, a decentralized, cross chain,<br />\r\ntoken management platform as a service.<br />\r\nFurther to this, DXB&rsquo;s initial token liquidity pool will be locked under DxSale&rsquo;s<br />\r\nDeFiLaunch certified Liquidity Locker, ensuring safety and security for our community of<br />\r\ninvestors.</p>\r\n\r\n<p>PancakeSwap is a Binance Smart Chainbased Decentralized Exchange (DEX) for<br />\r\nswapping BEP-20 tokens.<br />\r\nTo facilitate DXB&rsquo;s initial public offering, PancakeSwap offers our community the ability<br />\r\nto exchange their BNB for DXB.<br />\r\nIn line with a pragmatic approach, DXB shall be listed into major exchanges in the near<br />\r\nfuture.</p>\r\n\r\n<p><br />\r\nWe aim with the support of our community to facilitate the use of DXB token in key<br />\r\nsectors that interacts with our daily lives and offer DXB supporters additional rewards<br />\r\nout of the crypto universe.</p>', 0, 0, 1, 1),
(27, '2021-05-19 06:14:30.563156', '2021-07-07 15:39:50.799163', 'aboutuscontent3', '101 Schools', '<p>DXB is created with a goal and a purpose.<br />\r\nDXB wishes to bridge the gap between crypto world with real world within a secure<br />\r\nand safe environment.<br />\r\nGiving back is the main core value of DXB Token, therefore DXB Contract was built to<br />\r\ndedicate a generous amount set aside to give back to the community.<br />\r\nAlthough Charitable initiatives will be voted by the community, DXB&rsquo;s ultimate goal is<br />\r\nto build 101 schools around the world, and we won&rsquo;t stop until we do it.<br />\r\nA clear and ambitious plan was built by DXB team, Locations were pinpointed, and</p>\r\n\r\n<p>soon you will see the first school out of 101 being built and admitting those under-<br />\r\nprivileged who can&rsquo;t bear the cost of &ldquo;What we consider&rdquo; our basic need which is</p>\r\n\r\n<p>education.<br />\r\nDXB is set to improve the lives of everyone, even those who are still unfamiliar with the<br />\r\ncrypto world, this is accomplished by creating and operating smaller investment<br />\r\ninstitutes that can educate and help &ldquo;anyone&rdquo; to be part of the crypto revolution.</p>\r\n\r\n<p>DXB can only accomplish these ambitious goals with the help and support of the<br />\r\ncommunity.</p>', 0, 0, 1, 1),
(28, '2021-05-19 06:15:01.731721', '2021-06-28 15:24:51.374391', 'privacypolicy', 'Safety', 'We take the safety of holder&rsquo;s funds extremely seriously, and therefore we have taken the following measures to protect our community:\r\n<ul>\r\n	<li>Initial LP Token Lock</li>\r\n	<li>Cycle burns are fully controlled by the smart contract of the token.</li>\r\n	<li>Cycle burns are communicated publicly on a monthly basis.</li>\r\n	<li>Both Fee and Monthly Cycle burns are embedded in the contract.</li>\r\n	<li>Contract will be Audited by Industry Leader Auditors.</li>\r\n	<li>6% Team&rsquo;s Wallet Allocation locked for 6 months.</li>\r\n	<li>Fairly Distributed Presale. No Presale Wallets hold more than 1%</li>\r\n	<li>No minting function present within the contract.</li>\r\n	<li>DXB is therefore unruggable, with no single holder able to mint new tokens, change protocol,burn liquidity, or dump presale allocations on the market.</li>\r\n</ul>', 0, 0, 1, 1),
(29, '2021-05-19 06:15:39.643096', '2021-05-19 12:39:21.370570', 'privacypolicytwo', 'Our privacy policy are given below', '<h5 class=\"section_big_heading width_half mb-4\">Our privacy policy are given below :</h5>\r\n\r\n<p><i class=\"fas fa-check\"></i> &nbsp;&nbsp;Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s specimen book.</p>\r\n\r\n<p><i class=\"fas fa-check\"></i> &nbsp;&nbsp; Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s specimen book.Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>\r\n\r\n<p><i class=\"fas fa-check\"></i> &nbsp;&nbsp; Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s specimen book.Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>\r\n\r\n<p><i class=\"fas fa-check\"></i> &nbsp;&nbsp; Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s specimen book.Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>\r\n\r\n<p><i class=\"fas fa-check\"></i> &nbsp;&nbsp; Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s specimen book.Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>', 0, 0, 1, 1),
(30, '2021-05-19 06:16:20.534290', '2021-06-11 10:52:25.919639', 'terms', 'Use Case', '<ul>\r\n	<li>\r\n	<h5 class=\"section_big_heading width_half mb-4\"><span style=\"font-size:12px;\">DXB&rsquo;s team of developers are in process of developing a state-of-art software that willserve as payment gateway for all defi tokens, Once ready, DXB software will allow regular merchants who sell their products online to accept crypto currency as a form of payment in an easy and secure way.</span></h5>\r\n	</li>\r\n	<li>\r\n	<h5 class=\"section_big_heading width_half mb-4\"><span style=\"font-size:12px;\">This software will not only address the value fluctuation caused by price volatility, it will present new safety measures to reduce security risks associated while taking in considerations the commercial aspects of a transaction.</span></h5>\r\n	</li>\r\n	<li>\r\n	<h5 class=\"section_big_heading width_half mb-4\"><span style=\"font-size:12px;\">Once deployed, DXB software will change the way cryptocurrency &ldquo;Specially Defi&rdquo; is perceived and will create a whole new world of possibilities.Think of Uber, Booking.com, Deliveroo, Airlines, and any merchant accepting DXB as a form of payment in addition to other tokens.</span></h5>\r\n	</li>\r\n	<li>\r\n	<h5 class=\"section_big_heading width_half mb-4\"><span style=\"font-size:12px;\">DXB team is in process of recruiting large chains of products and services who are excited to utilize the crypto revolution to their advantage and to offer a whole new world of services to the clients. More on this topics will be discussed in future.</span></h5>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', 0, 0, 1, 1),
