(33, '2021-06-26 04:39:29.076506', '2021-07-09 11:00:13.489084', 'dxbcontentone', 'Community', 'We support each other and other communities, and we have fun doing it.', 1, 0, 1, 1),
(34, '2021-06-26 04:40:22.929564', '2021-07-09 10:59:12.390996', 'dxbcontenttwo', 'Charity', 'By donating to charity, we remind ourselves of our duty to make this world a better place for everyone. We are building 101 schools around the world.', 1, 0, 1, 1),
