(1, '2021-07-28 12:12:53.458053', '2021-07-28 12:12:53.458344', 'DXB', 'DXB', 'cryptocurrency', '500,000,000,000,000', 'DXB resides within a class of token that rewards investors just for holding, the amount\r\nof rewards received increases over time the longer an investor holds for and is\r\nproportionate to the amount of DXB they hold.\r\n\r\nHolders are also rewarded for the success of DXB through higher transaction volumes\r\nleading to increased profits taken from higher fee amounts from each transaction which\r\nwill be rewarded as BNB proportionally to holders\r\n\r\nWe believe this mechanism provides investors with an active stake in DXB’s success,\r\nand links DXB to a growing coin which is BNB that naturally gives it higher value.', 0, 1, 1, 'currencywhitepaper/DXB_White_Paper.pdf', '2022-01-26 00:00:00.000000', '0x000000000000000000', '0.25', 0, '79.00', '0.25', '25B DXB Token', '40B DXB Token', '15.00', '1.75', '0.25', 6, '2.50');

