(5, '2021-06-28 15:39:14.754615', '2021-06-28 15:39:14.754710', 'What is DXB?', 'DXB is a new token-based project that has chosen BSC to expand its payment gateways, decentralized trading and business plans.', 0, 1, 1),
(6, '2021-06-28 15:44:06.583551', '2021-06-28 15:44:06.583663', 'Who can use DXB?', 'DXB can be used by anyone with access to an internet connection and a web browser.', 0, 1, 1),
(7, '2021-06-28 15:44:21.194134', '2021-06-28 15:44:21.194231', 'How can I get DXB?', 'After the pre-sale, the distribution of DXB will happen only through PancakeSwap.', 0, 1, 1),
(8, '2021-06-28 15:44:39.250232', '2021-06-28 15:44:39.250322', 'What blockchain is DXB using?', 'DXB is built on the Binance Smart Chain. DXB can rely on a predictable base layer that has no outsized and unpredictable expenses. This allows the DXB token to use its fees creatively and boost its own economy.', 0, 1, 1),
(9, '2021-06-28 15:44:53.301067', '2021-06-28 15:44:53.301206', 'What is the use of Smart Contracts?', 'The DXB project has created proprietary smart contracts to complete its fees and incentives program. The presence of a smart contract will allow the tracking of each token transaction.', 0, 1, 1),
(10, '2021-06-28 15:45:08.533653', '2021-06-28 15:45:08.533749', 'Is DXB safe?', 'The security of the DXB token hinges on the properties of Binance Smart Chain. The chain is protected from malicious attacks by a combination of cryptography and reputational scores, as well as voting for the delegated nodes. Ownership of the BNB asset further ensures that the underlying block producers have “skin in the game” and are not willing to lose out on rewards through a network attack.', 0, 1, 1),
(11, '2021-06-28 15:45:24.060239', '2021-06-28 15:45:24.060332', 'What can I use DXB for?', 'DXB’s goal is to build an ecosystem of payments where the native token, alongside other digital coins and tokens, can help pay for services like Uber, airline travel, Booking.com and other services.', 0, 1, 1),
(12, '2021-06-28 15:45:36.725811', '2021-06-28 15:45:36.726098', 'What platform will it launch on?', 'DxSale is a decentralized, cross chain, token management platform as a service. Its goal is to launch the DXB token through the initial discount sale, until reaching a predetermined hard cap.', 0, 1, 1),
(13, '2021-06-28 15:45:57.390739', '2021-06-28 15:45:57.390817', 'What is DXB’s goal?', 'The end goal of DXB is to build a cross-chain payment system and drive adoption to multiple regions.', 0, 1, 1),
(14, '2021-06-28 15:46:11.212313', '2021-06-28 15:46:11.212401', 'How does DXB safeguard/secure its liquidity?', 'The project aims to set aside 70% of all liquidity for the PancakeSwap pool, where it will remain to achieve price discovery. An additional 21% will be democratically distributed in an airdrop. For the first six months of the project, the team wallet supply will remain locked for six months. Over time, the 7% transaction fee will eat away at the supply, while increasing the rug-proof liquidity pool. This will lead to the higher credibility of the DXB algorithmic liquidity pair.', 0, 1, 1);

